import React from 'react';
import { View, Text, ScrollView, StyleSheet, ActivityIndicator, TouchableOpacity } from 'react-native';
import { SafeAreaView } from 'react-native-safe-area-context';
import { useNavigation } from '@react-navigation/native';
import { useGetStocksQuery } from '../services/stockApi';
import { StockCard } from '../components/StockCard';
import { Stock } from '../types/models';
import { NativeStackNavigationProp } from '@react-navigation/native-stack';

type RootStackParamList = {
  Home: undefined;
  StockDetail: { stockId: string };
};

type HomeScreenNavigationProp = NativeStackNavigationProp<RootStackParamList, 'Home'>;

const HomeScreen = () => {
  const navigation = useNavigation<HomeScreenNavigationProp>();
  const { data: stocks, error, isLoading } = useGetStocksQuery();

  // Mock data for when API fails
  const mockStocks: Stock[] = [
    { sid: 'MOCK1', symbol: 'AAPL', name: 'Apple Inc.', currentPrice: 170.50, previousClose: 169.80, exchange: 'NASDAQ', sector: 'Technology' },
    { sid: 'MOCK2', symbol: 'GOOGL', name: 'Alphabet Inc.', currentPrice: 2800.75, previousClose: 2790.50, exchange: 'NASDAQ', sector: 'Communication Services' },
    { sid: 'MOCK3', symbol: 'MSFT', name: 'Microsoft Corporation', currentPrice: 300.20, previousClose: 299.50, exchange: 'NASDAQ', sector: 'Technology' },
  ];



  const handleStockPress = (stockId: string) => {
    navigation.navigate('StockDetail', { stockId });
  };

  if (isLoading) {
    return (
      <SafeAreaView style={styles.container}>
        <View style={styles.centerContainer}>
          <ActivityIndicator size="large" color="#3b82f6" />
          <Text style={styles.loadingText}>Loading stocks...</Text>
        </View>
      </SafeAreaView>
    );
  }

  // If there's an error, display mock data to improve UI
  if (error) {
    return (
      <SafeAreaView style={styles.container}>
        <ScrollView>
          <View style={styles.header}>
            <Text style={styles.title}>Oshan</Text>
            <Text style={styles.subtitle}>Premium Market Intelligence</Text>
          </View>
          <View style={styles.content}>
            <Text style={styles.sectionTitle}>Top Stocks</Text>
            <View style={styles.stockList}>
              {mockStocks.map((stock) => (
                <StockCard
                  key={stock.sid}
                  stock={stock}
                  onPress={() => handleStockPress(stock.sid)}
                />
              ))}
            </View>
          </View>
        </ScrollView>
      </SafeAreaView>
    );
  }

  // If there's no error but no stocks, display "No stocks available"
  if (!stocks || stocks.length === 0) {
    return (
      <SafeAreaView style={styles.container}>
        <ScrollView>
          <View style={styles.header}>
            <Text style={styles.title}>Oshan</Text>
            <Text style={styles.subtitle}>Premium Market Intelligence</Text>
          </View>
          <View style={styles.content}>
            <Text style={styles.sectionTitle}>Top Stocks</Text>
            <Text style={styles.emptyText}>No stocks available</Text>
          </View>
        </ScrollView>
      </SafeAreaView>
    );
  }

  const { theme } = useTheme();
  const styles = createStyles(theme);

  return (
    <SafeAreaView style={styles.container}>
      <ScrollView>
        <View style={styles.header}>
          <Text style={styles.title}>Oshan</Text>
          <Text style={styles.subtitle}>Premium Market Intelligence</Text>
        </View>

        {/* Render actual stocks */}
        <View style={styles.stockList}>
          {stocks.map((stock) => (
            <StockCard
              key={stock.sid}
              stock={stock}
              onPress={() => handleStockPress(stock.sid)}
            />
          ))}
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

const createStyles = (theme: Theme) => StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: theme.colors.background,
  },
  centerContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    padding: 20,
  },
  header: {
    paddingHorizontal: 24,
    paddingVertical: 32,
    backgroundColor: theme.colors.surface,
    borderBottomWidth: 1,
    borderBottomColor: theme.colors.border,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.05,
    shadowRadius: 8,
    elevation: 1,
  },
  title: {
    fontSize: 32,
    fontWeight: '800',
    color: theme.colors.text,
    letterSpacing: -0.5,
  },
  subtitle: {
    fontSize: 16,
    color: theme.colors.textSecondary,
    marginTop: 8,
    fontWeight: '500',
    letterSpacing: 0.2,
  },
  content: {
    padding: 24,
  },
  sectionTitle: {
    fontSize: 24,
    fontWeight: '700',
    color: theme.colors.text,
    marginBottom: 20,
    letterSpacing: -0.3,
  },
  stockList: {
    marginHorizontal: -8,
    padding: 16,
  },
  loadingText: {
    fontSize: 18,
    color: theme.colors.textSecondary,
    marginTop: 16,
    fontWeight: '500',
  },
  errorText: {
    fontSize: 20,
    fontWeight: '700',
    color: '#ef4444',
    marginBottom: 12,
  },
  errorDetails: {
    fontSize: 16,
    color: theme.colors.textSecondary,
    textAlign: 'center',
    lineHeight: 22,
  },
  emptyText: {
    fontSize: 18,
    color: theme.colors.textSecondary,
    textAlign: 'center',
    marginTop: 48,
    fontWeight: '500',
  },
});

export default HomeScreen;
